import React, { Fragment } from 'react';
import { AppBar, Toolbar, Typography } from '@material-ui/core';
import { Tabs, Tab, Button } from '@material-ui/core';

function LinkTab(props) {
  return <Tab component="a" onClick={event => event.preventDefault()} {...props} />;
}

const Header = (props) => {
  const value = props.value;
  const handler = props.handleChange;
  return (
    <Fragment>
    <AppBar position="static">
    <Toolbar>
          <Typography variant="h6" color="inherit" style={{fontFamily: "'Dancing Script', Lato", flex: 1}}>
            Shree Silks
          </Typography>
          <Button color="inherit">Login</Button>
      </Toolbar>
    </AppBar>
    <Tabs centered value={value} onChange={handler} indicatorColor="primary">
      <LinkTab label="Home" href="/home"/>
      <LinkTab label="Sarees" href="/sarees" />
      <LinkTab label="Contact us" href="/contact-us" />
    </Tabs>
    </Fragment>
  );
}

export default Header;
